result:
query($slug: String) {
  strapi {
    areaGuides(where: { slug: $slug }) {
      id
      title
      description
      image {
        url
      }
      slug
      gallery {
        url
      }
    }
    global {
      siteName
      favicon {
        url
      }
      defaultSeo {
        metaTitle
        metaDescription
        shareImage {
          url
        }
      }
    }
  }
}
